public class RelationalOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int num1 =10;
		int num2=20;
		boolean result=num1==num2;
		
		System.out.println(num1==num2);
		System.out.println(num1);
		System.out.println(result);
		
		System.out.println("*****************************");
	}

}
